const add_price = (data) => {
    return (dispatch) => {
        dispatch(
            {
                type: "CREATE",
                payload: data
            }
        )
    }
}

const remove_price = (data) => {
    return (dispatch) => {
        dispatch(
            {
                type: "GET",
                payload: data
            }
        )
    }
}

export {
    add_price,
    remove_price
}
